.entry-content ul li:before {
 content: "•";
 color: #ff0000;
 margin-right: 10px;
}

.entry-content ol {
 counter-reset: item;
}
.entry-content ol li {
 display: block;
 position: relative;
}
.entry-content ol li:before {
 content: counter(item) ". ";
 counter-increment: item;
 position: absolute;
 left: -25px;
 color: #ff0000;
}

.entry-content blockquote {
 border-left: 3px solid #ff0000;
 padding-left: 15px;
 margin-left: 0;
 font-style: italic;
}

.entry-content table {
 width: 100%;
 border-collapse: collapse;
 margin: 20px 0;
}
.entry-content table, .entry-content th, .entry-content td {
 border: 1px solid #ddd;
}
.entry-content th, .entry-content td {
 padding: 8px;
 text-align: left;
}
.entry-content th {
 background-color: #f2f2f2;
}

.entry-content pre {
 background: #f4f4f4;
 border: 1px solid #ddd;
 border-left: 3px solid #ff0000;
 color: #666;
 page-break-inside: avoid;
 font-family: monospace;
 font-size: 15px;
 line-height: 1.6;
 margin-bottom: 1.6em;
 max-width: 100%;
 overflow: auto;
 padding: 1em 1.5em;
 display: block;
 word-wrap: break-word;
}

.entry-content code {
 background: #f4f4f4;
 border: 1px solid #ddd;
 border-left: 3px solid #ff0000;
 color: #666;
 font-family: monospace;
 padding: 3px;
}

.entry-content img {
 max-width: 100%;
 height: auto;
}

.entry-content a {
 color: #ff0000;
 text-decoration: none;
}
.entry-content a:hover {
 text-decoration: underline;
}

/* Responsive Design */
@media screen and (max-width: 768px) {
 .entry-content {
  padding: 10px;
 }
 .entry-content h1 {
  font-size: 24px;
 }
 .entry-content h2 {
  font-size: 20px;
 }
 .entry-content h3 {
  font-size: 18px;
 }
 .entry-content h4, .entry-content h5, .entry-content h6 {
  font-size: 16px;
 }
}
